# This cell will check the retweeted_status column of your tweets. If that column is empty, the tweet is an original tweet. 
#If that column is not empty, it means the tweet is a retweet, and we can make a new row based on what's contained in that column.
for index, row in df.iterrows(): #looping over all rows
  if pd.notnull(row['retweeted_status']): #checking if retweeted_status is empty or not
    tweet_id = row['retweeted_status']['id_str']
    if tweet_id in df['id_str'].values: # if the id is already in our dataframe we increment the retweet_count. 
      i = df[df['id_str']== tweet_id].index.values[0]
      df.at[i,'retweet_count'] = df.at[i,'retweet_count'] + 1 
    else: # otherwise we create a new row
      df = df.append(row['retweeted_status'], ignore_index=True)
print("\nNumber of tweets in your data collection now:")
print(len(df))

# This cell will chronologically sort the tweets 

for index, row in df.iterrows():
  tweet_created_at  = pd.to_datetime(row["created_at"]) # we need to convert the created_at string to a date time object to facilitate sorting
  df.at[index,'created_at'] = tweet_created_at


